import React from 'react';

const ContactUs = () => {
  return (
    <section className="contact-section">
      <h2>Contact Us</h2>
      <p>
        For any inquiries or questions, please fill out the form below or reach out to us at example@example.com.
      </p>
      <form>
        {/* Add form fields here */}
      </form>
    </section>
  );
}

export default ContactUs;
